import Card from "react-bootstrap/Card";

const CreateMis = () => {
  const createMis = () => {};
  return (
    <Card onClick={createMis()}>
      <Card.Header className="cardTitle">Create MIS</Card.Header>
      <Card.Body>
        <Card.Text></Card.Text>
        <Card.Text></Card.Text>
      </Card.Body>
    </Card>
  );
};

export default CreateMis;
